import React, {Component} from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from 'react-router-dom';
import DropdownButton from ''

import AboutUsPage from "../Pages/About_Us/AboutUsPage";
import HomePage from "../Pages/Home/HomePage";
import ContactPage from "../Pages/Contact/ContactPage";
import LoginPage from "../Pages/Login/LoginPage";

class TopNavigationBar extends Component {
    render() {
        return (
            <Router>
                <div>
                    <nav>
                        <ul>
                            <li><Link to="/">HOME</Link></li>
                            <li><Link to="/aboutus">ABOUT US</Link></li>
                            <li>
                                <DropdownButton title="Services">
                                    <Dropdown.Item href="/digital-pathology-solutions">DIGITAL PATHOLOGY SOLUTIONS</Dropdown.Item>
                                    <Dropdown.Item href="/diagnostic-cardiology-solutions">DIAGNOSTIC CARDIOLOGY SOLUTIONS</Dropdown.Item>
                                    <Dropdown.Item href="/diagnostic-radiology-solutions">DIAGNOSTIC RADIOLOGY SOLUTIONS</Dropdown.Item>
                                </DropdownButton>
                            </li>
                            <li><Link to="/contact">CONTACT</Link></li>
                            <li><Link to="login">Log In</Link></li>
                        </ul>
                    </nav>
                    <Switch>
                        <Route exact path="/">
                            <HomePage/>
                        </Route>
                        <Route path="/aboutus">
                            <AboutUsPage/>
                        </Route>
                        <Route path="/contact">
                            <ContactPage/>
                        </Route>
                        <Route path="/login">
                            <LoginPage/>
                        </Route>
                    </Switch>
                </div>
            </Router>
        );
    }
}

export default TopNavigationBar;
